/** @format */

import React from "react";
import {
  FormBlock,
  InputBlock,
  ButtonBlock,
  ABlock,
} from "../components/StyleForm";
const SignUp = () => {
  return (
    <FormBlock>
      <h1>회원가입 </h1>
      <InputBlock
        name="user-id"
        placeholder="아이디"
        // value={id}
        // onChange={onChangeId}
      />

      <InputBlock
        name="user-password"
        // placeholder="비밀번호"
        // value={password}
        // onChange={onChangePassword}
      />
    </FormBlock>
  );
};

export default SignUp;
